  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"javascript"}}>{`JavaScript`}</MDXTag>
<MDXTag name="p" components={components}>{`Here's an example of Generators.`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-js"}}>{`function* myGen() {
  yield 10;
  yield 20;
  yield 30;
}

const g = myGen()
g.next().value  // 10
g.next().value  // 20
g.next().value  // 30
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
MDXContent.isMDXComponent = true
